import "./App.scss";
import logo from "./images/logo1.jpeg";

function App() {
  return (
    <div className="App">
      <nav className="nav">
        <text style={{ textAlign: "center" }}>NextJs/ReactJs Assignment</text>
      </nav>
      <div>
        <img src={logo} alt=".." />
      </div>
    </div>
  );
}

export default App;
